import React from 'react'

function contact() {
  return (
    <div
      style={{
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
        height: '90vh'
      }}
    >
      <h1>Contact us</h1>
    </div>
  )
}

export default contact
